import React, { useState } from 'react';
import Layout from '../../components/Layout';




const Index = () => {
    // 声明一个新的叫做 “count” 的 state 变量
    const [count, setCount] = useState(0);
    return (
        <div>
            <Layout>
                <p>我是首页,请你配合 {count} times</p>
            </Layout>
        </div>
    );
};

export default Index;
